import React from "react";
import styled, { keyframes } from "styled-components";
import {
  BGContentShopTeam,
  DiamondContainerBottom,
  DiamondContainerLeft,
  DiamondContainerTop,
  LOGOBGContainer,
  ShopTeamContentContainer,
} from "./style";

const aminationBorder = keyframes`
    from {
        border-top-color: #0cc9c9;
    }
    to {
        border-top-color: #fff;
    }
`;

const LogoContainer = styled.div`
  width: 125px;
  height: 100%;
  position: relative;
  &:hover ${DiamondContainerTop} {
    top: 30px;
    width: 6px;
    height: 6px;
    transition: top 2s, width 1s, height 1s;
  }
  &:hover ${DiamondContainerLeft} {
    left: 26px;
    width: 8px;
    height: 8px;
    transition: left 2s, width 1s, height 1s;
  }
  &:hover ${DiamondContainerBottom} {
    bottom: 30px;
    opacity: 0;
    transition: bottom 2s, opacity 2s;
  }
  &:hover ${LOGOBGContainer} {
    border-top-color: #fff;
    border-right-color: #fff;
    animation: aminationBorder 2s infinite;
    transition-delay: 0s;
  }
  &:hover ${BGContentShopTeam} {
    background: none;
    transition-delay: 0s;
  }
`;

function Index() {
  return (
    <>
      <LogoContainer>
        <LOGOBGContainer>
          <DiamondContainerTop />
          <DiamondContainerLeft />
          <DiamondContainerBottom />
        </LOGOBGContainer>
        <BGContentShopTeam>
          <ShopTeamContentContainer>SHOP TEAM</ShopTeamContentContainer>
        </BGContentShopTeam>
      </LogoContainer>
    </>
  );
}

export default Index;
